import React from "react";
import { Link } from "react-router-dom";
import {
  Wrapper,
  StyledSection,
  StyledParagraph,
  StyledInput,
} from "../../components/Wrapper/styles";

export const LoginScreen = () => {
  return (
    <Wrapper>
      <StyledSection>
        <StyledParagraph>
          <p style={{ textAlign: "center", fontWeight: 700 }}>
            Log in to the blog
          </p>
        </StyledParagraph>
        <StyledInput type="email" />
        <StyledInput type="password" />
        <button>
          <Link to="/main">Go </Link>
        </button>
      </StyledSection>

      <StyledSection>
        <StyledParagraph>
          <p style={{ textAlign: "center" }}>Go to blog without logging in</p>
        </StyledParagraph>
        <button>
          <Link to="/main">Go without</Link>
        </button>
      </StyledSection>
    </Wrapper>
  );
};
